import React, { Component } from 'react';
import './App.css';
import axios from 'axios'


const apiKey = process.env.REACT_APP_USDA_DATABASE_API_KEY;
const nutrients = "nutrient=2";
console.log(apiKey);
class App extends Component {
  constructor() {
    super()
    this.state = {

    }
  }

  componentDidMount() {
    fetch(`https://api.nal.usda.gov/ndb/nutrients/?format=xml&api_key=${apiKey}&nutrients=203&nutrients=204&nutrients=208&nutrients=205`)
      .then(response => response.json())
      .then(data => {
        console.log(data);
      })
  }


  render() {
    return (
      <div className="App">
        <h1>Hello World</h1>

        <nav>
          <ul>
            <li></li>
          </ul>
        </nav>

        <main>
        </main>

      </div>
    );
  }
}

export default App;
